import React from 'react'
import { StyleSheet } from 'react-native'

const Styles = StyleSheet.create({
    top: {
        backgroundColor: '#26d40f',
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    bottom: {
        backgroundColor: '#000'
    },
    container: {
        flex: 1,
        justifyContent: 'flex-start',
        alignContent: 'flex-start',
    },
    image: {
        width: 190,
        height: 200,
        resizeMode: 'contain',
        alignSelf: 'flex-end',
        marginRight: '3%',
        marginBottom: '20%'
    },
    subtitle: {
        paddingLeft: 15,
        fontSize: 24,
        fontWeight: '300',
        color: '#fff'
    },
    title: {
        paddingLeft: 15,
        fontSize: 32,
        fontWeight: 'bold',
        color: '#fcf800',
    },
    areaIcon: {
        alignSelf: 'center',
        marginRight: 10
    },
    areaInput: {
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center'
    },
    input: {
        backgroundColor: '#ebedec',
        height: 45,
        borderWidth: 1,
        borderColor: '#d9d9d9',
        width: 280,
        borderRadius: 4,
        textAlign: 'right',
    },
    infoInput: {
        fontSize: 14,
        fontWeight: '900'
    },
    button: {
        backgroundColor: '#34CB79',
        height: 50,
        flexDirection: 'row',
        borderRadius: 10,
        overflow: 'hidden',
        alignItems: 'center',
        marginTop: 8,
        width: 230,
        justifyContent: 'center'
    },
    textButton: {
        fontSize: 26,
        fontWeight: '200',
        color: '#fff',
    },
    iconButton: {
        marginRight: 3
    }
})


export default Styles
